已知条件：
1. “日用百货”包括“板凳”;
2. “凳子”包括“生活用品”;
3. “生活用品”包括“板凳”;
4. “凳子”和“凳”是相同的东西;
5. “凳”和“板凳”是相同的东西;
6. “凳子”和“板凳子”是相同的东西;
7. “板凳子”和“板凳”是相同的东西。

根据已知条件可得，“凳子”包括“板凳子”，而“板凳子”和“板凳”是相同的东西，因此“凳子”包括“板凳”。答案是是。

已知条件：

1. “梭子蟹”包括“活螃蟹”;
2. “活蟹”包括“梭子蟹”;
3. “活河蟹”包括“活螃蟹”;
4. “活蟹”包括“活河蟹”。

根据以上四个条件，可以推断：“活蟹”包括“活螃蟹”。

答案：是。
